import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <Link to="/">Rooms</Link>
      <Link to="/my-bookings">My Bookings</Link>
      {<Link to="/admin">Admin Panel</Link> }
      <Link to="/book/:roomId">Book</Link>
    </nav>
  );
};

export default Navbar;
